import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Login from './Login';
// import Dashboard from './Dashboard';
// import PrivateRoute from './PrivateRoute';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Login />} />

      </Routes>
    </div>
  );
}

export default App;
